import * as firebase from "firebase/app";
import "firebase/storage";
import "firebase/firestore";

// Your web app's Firebase configuration
var firebaseConfig = {
  apiKey: "AIzaSyBcxVXHlQJAXhReXiEFXXt-2tE-RZsb2o8",
  authDomain: "blog-9bdd6.firebaseapp.com",
  databaseURL: "https://blog-9bdd6.firebaseio.com",
  projectId: "blog-9bdd6",
  storageBucket: "blog-9bdd6.appspot.com",
  messagingSenderId: "692181516194",
  appId: "1:692181516194:web:3498fd82f7de6d222b3cfb",
};
// Initialize Firebase
firebase.initializeApp(firebaseConfig);

const timestamp = firebase.firestore.FieldValue.serverTimestamp;

const projectStorage = firebase.storage();
const projectFirestore = firebase.firestore();

export { projectStorage, projectFirestore, timestamp };
